webpackJsonp([0xfee5c0e96b71],{524:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Пятиминутка React",author:"Пятиминутка React"}},markdownRemark:{id:"/Users/petr/www/5minreact.ru/src/pages/screeencast_async_await_to_generators/index.md absPath of file >>> MarkdownRemark",html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <iframe src="https://www.youtube.com/embed/czgxE_UQnDQ" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<p>В этом скринкасте я хочу повнимательнее посмотреть на работу async/await.\nПопробуем вручную транспилировать async/await в генераторы, посмотрим как это делают Babel и TypeScript.</p>\n<p><a href="https://bit.ly/2L0RtMf">https://bit.ly/2L0RtMf</a> - TypeScript Playground\n<a href="https://bit.ly/2RmELsu">https://bit.ly/2RmELsu</a> - Babel Playground</p>',frontmatter:{title:"Траспиляция из async/await в генераторы",date:"June 18, 2019",featuredImage:null}}},pathContext:{slug:"/screeencast_async_await_to_generators/",previous:{fields:{slug:"/screeencast_for_loops_are_complicated/"},html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <iframe src="https://www.youtube.com/embed/gAPh2W8qcUY" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<p>На днях я смотрел занятное видео с погружением в цикл for: <a href="https://youtu.be/Nzokr6Boeaw">https://youtu.be/Nzokr6Boeaw</a></p>\n<p>Оно побудило записать меня этот скринкаст, чтобы своими словами раскрыт тему областей видимости переменных при использовании циклов.</p>',excerpt:"На днях я смотрел занятное видео с погружением в цикл for:  https://youtu.be/Nzokr6Boeaw Оно побудило записать меня этот скринкаст, чтобы…",frontmatter:{title:"JavaScript for-loops are… complicated",date:"June 17, 2019",featuredImage:null}},next:{fields:{slug:"/54-youtube-screencasts/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/641013810&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал.</p>\n<p>Но только этом году я попробовал записывать полноценные скринкасты: видео где показывается реализация какого-то алгоритма на JavaScript. Выбрал не самые простые темы, но интересные (по крайней мере мне). </p>\n<p>Что самое главное, постарался рассказать подробно и понятно, разбивая задачу на отдельные шаги, комментируя принимаемые решения, отвечая на собственные вопросы по ходу. Мне кажется, получилось не плохо, буду продолжать ещё.</p>\n<p>Подписывайтесь: <a href="https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw">https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw</a></p>',excerpt:"Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал. Но только этом году я попробовал записывать…",frontmatter:{title:"Скринасты Пятиминутки React на YouTube",date:"June 23, 2019",featuredImage:null}}}}}});
